import { Route, Routes, Navigate } from "react-router-dom";
import PokeList from "../components/PokeList";

function RouteList({ pokemon }) {
    return (
        <Routes>
            <Route path="/pokemon/:name"
                   element={<PokeList pokemon={pokemon}/>}
            />

            <Route path="/*"
                   element={<Navigate to="/" />}
            />
        </Routes>
    )
}

export default RouteList;
